import { createCanvas, Image } from 'canvas';
import sp from 'synchronized-promise';

export default class Theme {
  static #Parts = {
    Panel: 'PANEL',
    Button: 'BUTTON_A',
    ButtonHover: 'BUTTON_A_HOVER',
    ButtonPressed: 'BUTTON_A_PRESSED',
    InputBackground: 'INPUT_BACKGROUND',
    Test: 'TEST',
  };

  static #Colors = {
    Inherit: 'Inherit',
    Blue: 'Blue',
    Gray: 'Grey',
    Grey: 'Grey',
  };

  static #images = {
    Blue: 'data:image/png;base64,"',
    Grey: 'data:image/png;base64,',
  };

  static #parts = {
    Blue: [{
      key: 'PANEL',
      x: 190,
      y: 94,
      width: 100,
      height: 100,
    }, {
      key: 'BUTTON_B',
      x: 190,
      y: 194,
      width: 49,
      height: 45,
    }, {
      key: 'BUTTON_A',
      x: 337,
      y: 184,
      width: 49,
      height: 49,
    }, {
      key: 'BUTTON_A_HOVER',
      x: 239,
      y: 194,
      width: 49,
      height: 49,
    }, {
      key: 'BUTTON_A_PRESSED',
      x: 339,
      y: 94,
      width: 49,
      height: 49,
    }, {
      key: 'INPUT_BACKGROUND',
      x: 288,
      y: 194,
      width: 49,
      height: 49,
    }, {
      key: 'DOWN_ARROW',
      x: 416,
      y: 72,
      width: 28,
      height: 42,
    }, {
      key: 'UP_ARROW',
      x: 388,
      y: 72,
      width: 28,
      height: 42,
    }],

    Grey: [{
      key: 'PANEL',
      x: 190,
      y: 98,
      width: 100,
      height: 100,
    }, {
      key: 'BUTTON',
      x: 0,
      y: 143,
      width: 190,
      height: 49,
    }, {
      key: 'BUTTON_HOVER',
      x: 0,
      y: 0,
      width: 188,
      height: 49,
    }],
  };

  static get Colors() {
    return this.#Colors;
  }

  static get Parts() {
    return this.#Parts;
  }

  #color = null;
  #assets = {};

  constructor(color = Theme.Colors.Inherit) {
    this.color = color;
    this.#assets.EMPTY = createCanvas(1, 1);
  }

  get color() {
    return this.#color;
  }

  set color(val) {
    this.#color = val;
    this.#preload();
  }

  #createImage() {
    return new Promise((resolve, reject) => {
      this.#assets.image = new Image();
      this.#assets.image.onload = () => {
        resolve();
      };
      this.#assets.image.onerror = (err) => {
        delete this.#assets.image;
        reject(err);
      };
      this.#assets.image.src = Theme.#images[this.#color];
    });
  }

  #preload() {
    // Force this to by sync
    // The image is a data URI so it will be fast
    sp(this.#createImage());

    Theme.#parts[this.#color].forEach((entry) => {
      this.#assets[entry.key] = createCanvas(entry.width, entry.height);
      const ctx = this.#assets[entry.key].getContext('2d');
      ctx.drawImage(
        this.#assets.image,
        entry.x,
        entry.y,
        entry.width,
        entry.height,
        0,
        0,
        entry.width,
        entry.height,
      );
    });
  }

  draw9slice = (canvasCtx, partName, x, y, width, height) => {
    let image = this.#assets.EMPTY;
    if (this.#assets.image && this.#assets[partName]) {
      image = this.#assets[partName];
    }

    const imageWidth = Math.ceil(image.width / 3);
    const imageHeight = Math.ceil(image.height / 3);

    const part1 = [0, 0, imageWidth, imageHeight];
    const part2 = [imageWidth, 0, imageWidth, imageHeight];
    const part3 = [imageWidth * 2, 0, imageWidth, imageHeight];
    const part4 = [0, imageHeight, imageWidth, imageHeight];
    const part5 = [imageWidth, imageHeight, imageWidth, imageHeight];
    const part6 = [imageWidth * 2, imageHeight, imageWidth, imageHeight];
    const part7 = [0, imageHeight * 2, imageWidth, imageHeight];
    const part8 = [imageWidth, imageHeight * 2, imageWidth, imageHeight];
    const part9 = [imageWidth * 2, imageHeight * 2, imageWidth, imageHeight];

    let centerPartsWidth = width - 2 * imageWidth;
    if (centerPartsWidth < 0) {
      centerPartsWidth = 0;
    }

    // top left
    canvasCtx.drawImage(
      image,
      ...part1,
      x + 0,
      y + 0,
      imageWidth,
      imageHeight,
    );
    // top right
    canvasCtx.drawImage(
      image,
      ...part3,
      x + width - imageWidth,
      y + 0,
      imageWidth,
      imageHeight,
    );
    // bottom left
    canvasCtx.drawImage(
      image,
      ...part7,
      x + 0,
      y + height - imageHeight,
      imageWidth,
      imageHeight,
    );
    // bottom right
    canvasCtx.drawImage(
      image,
      ...part9,
      x + width - imageWidth,
      y + height - imageHeight,
      imageWidth,
      imageHeight,
    );
    // top
    canvasCtx.drawImage(
      image,
      ...part2,
      x + imageWidth,
      y + 0,
      centerPartsWidth,
      imageHeight,
    );
    // bottom
    canvasCtx.drawImage(
      image,
      ...part8,
      x + imageWidth,
      y + height - imageHeight,
      centerPartsWidth,
      imageHeight,
    );
    // left
    canvasCtx.drawImage(
      image,
      ...part4,
      x + 0,
      y + imageHeight,
      imageWidth,
      height - 2 * imageHeight,
    );
    // right
    canvasCtx.drawImage(
      image,
      ...part6,
      x + width - imageWidth,
      y + imageHeight,
      imageWidth,
      height - 2 * imageHeight,
    );
    // center
    canvasCtx.drawImage(
      image,
      ...part5,
      x + imageWidth,
      y + imageHeight,
      centerPartsWidth,
      height - 2 * imageHeight,
    );
  };
}
